import Vue from "vue";
import VueObservable from "vue-observable";

Vue.use(VueObservable);

const store = Vue.observable({
  appName: "Melhor Frete",
  city: null,
  weight: null,
  showOutput: false,
  frete: {
    menorValor: {
      transportadora: "",
      tempo: "",
      preco: "",
    },
    maisRapido: {
      transportadora: "",
      tempo: "",
      preco: "",
    },
  },
  citys: [
    // lista de cidades
  ],
});

const mutations = {
  setCity(city) {
    store.city = city;
  },
  setWeight(weight) {
    store.weight = weight;
  },
  setShowOutput(showOutput) {
    store.showOutput = showOutput;
  },
  setFrete(frete) {
    store.frete = frete;
  },
};

export default {
  store,
  ...mutations,
};
